import React, {useState,useEffect, Fragment} from "react";
import Table from 'react-bootstrap/Table';

const CRUD = () => {

    const empdata = [
        {
           id : 1,
           name : 'Apple',
           price :  100
        },
        {
            id : 2,
            name : 'Pear',
            price :  90
         },
         {
            id : 3,
            name : 'Cherry',
            price :  80
         },
         {
            id : 4,
            name : 'Apricot',
            price :  70
         }
    ]

    const [data,setData] = useState([]);

    useEffect(()=>{
        setData(empdata);
    },[])

    return(
        <Fragment>
<Table striped bordered hover>
      <thead>
        <tr>
          <th>#</th>
          <th>ID</th>
          <th>Name</th>
          <th>Price</th>
        </tr>
      </thead>
      <tbody>
        {
            data && data.length > 0 ?
            data.map((item,index) =>
            {
                return (
                        <tr key={index}>
            <td>{item.id}</td>
            <td>{item.name}</td>
            <td>{item.cost}</td>
            </tr>      
                )
            })
            :
            'Loading...'
        }
      
      </tbody>
    </Table>
        </Fragment>
    )
}


export default CRUD;
